def get_json(url)
    # uri = URI.parse(url)
    begin
    response = Typhoeus.get(url)
    rescue
      retry
    end
    # response = Net::HTTP.get_response(uri)
    data = response.body
    # puts response.body
    result = JSON.parse(data)

    return result    
end
  
